  },
  beforeUnmount() {
    // Clean up slick instance when leaving the page
    this.destroySlider();
  },
  methods: {
    initSlider() {
      // run after DOM update
      this.$nextTick(() => {
        const $ = window.$ || window.jQuery;
        if (!($ && typeof $(".active-slider-def").slick === "function")) return;
        const $slider = $(".active-slider-def");
        try {
          if ($slider.hasClass("slick-initialized")) {
            $slider.slick("refresh");
          } else {
            $slider.slick({
              dots: false,
              infinite: true,
              speed: 500,
              slidesToShow: 1,
              slidesToScroll: 1,
              autoplay: false,
              adaptiveHeight: true,
              arrows: true,
              prevArrow: '<span class="slider-navigation slider-navigation-left"><i class="icofont-long-arrow-left"></i></span>',
              nextArrow: '<span class="slider-navigation slider-navigation-right"><i class="icofont-long-arrow-right"></i></span>'
            });
          }
        } catch (e) {
          // if initialization fails, silently ignore to avoid breaking the page
          // console.warn('Slider init failed', e)
        }
      });
    },
    destroySlider() {
      const $ = window.$ || window.jQuery;
      if (!($ && typeof $(".active-slider-def").slick === "function")) return;
      const $slider = $(".active-slider-def");
      try {
        if ($slider.hasClass("slick-initialized")) {
          $slider.slick("unslick");
        }
      } catch (e) {
        // ignore
      }
    }
  }
